import React from 'react';
import { Tabs } from 'antd';
import StyledTitle from './Titles';

const { TabPane } = Tabs;

const frontendList = [
  {
    id: 0,
    title: 'Travelary',
    img: '',
  },
];

const PortpolioList = () => {
  return (
    <div>
      <StyledTitle>
        <span>Portpolio List ✨</span>
      </StyledTitle>
      <Tabs defaultActiveKey='1' centered>
        <TabPane tab='Front-end(2)' key='1'>
          <ul>
            {frontendList.map((list) => {
              return (
                <li key={list.id}>
                  <p>{list.title}</p>
                </li>
              );
            })}
          </ul>
        </TabPane>
        <TabPane tab='Publishing()' key='2'></TabPane>
      </Tabs>
    </div>
  );
};

export default PortpolioList;
